import React from 'react';
import { findByLabelText } from '@testing-library/react';
import { withRouter } from 'react-router-dom';

function Home() {

    const homeStyle = {
        height: '120vmin',
        backgroundImage: 'url("/images/homeDark.png")',
        backgroundRepeat: 'no-repeat',
        backgroundSize: '100% auto',
    }

    const imgLbl = {
        color: '#fff',
        margin: '0',
        paddingTop: '10vh',
        fontFamily: 'arial, san-serif',
        fontSize: '4.5vw',
        fontWeight: '100',
    }

  return (
    <div className="content">
        <div style={ homeStyle }>
            <h2 style={imgLbl}>
                Restoration, Repair &amp; Waterproofing
            </h2>
        </div>
    </div>
  );
}

export default Home;
